class Solution:
    def canFinish(self, numCourses: int, prerequisites: List[List[int]]) -> bool:
        child = defaultdict(set)
        parent = defaultdict(int)
        for p in prerequisites:
            child[p[1]].add(p[0])
            parent[p[0]]+=1

        q = deque()
        for i in range(numCourses):
            if parent[i] == 0:
                del parent[i]
                q.append(i)
        if not q:
            return False
        res = []
        while q:
            couses = q.popleft()
            res.append(couses)
            for c in child[couses]:
                parent[c] -= 1
                if parent[c] == 0:
                    del parent[c]
                    q.append(c)

        return len(res) == numCourses

class Solution:

    def canFinish(self, numCourses: int, prerequisites: List[List[int]]) -> bool:
        graph = [[] for _ in range(numCourses)]
        for x, y in prerequisites:
            graph[x].append(y)

        state = [UNDISCOVERED] * numCourses
        for vertex in range(numCourses):
            if not self.dfs(graph, vertex, state):
                return False

        return True

    def dfs(self, graph, v, state):
        stack = [(v, 0)]
        while stack:
            curr, pos = stack[-1]
            if state[curr] == PROCESSED:
                stack.pop()
                continue
            if state[curr] == DISCOVERED and pos == 0:
                return False
            if pos == 0:
                state[curr] = DISCOVERED

            for i in range(pos, len(graph[curr])):
                stack[-1] = curr, pos + 1
                stack.append((graph[curr][i], 0))
                break
            else:
                state[curr] = PROCESSED

        return True

