class Solution:
    def __init__(self):
        self.vis = [[]]
        self.rank = [[]]

    def parent(self,i,j,pvec):
        if pvec[i][j]==(i,j):
            return i,j
        pvec[i][j] = self.parent(pvec[i][j][0],pvec[i][j][1],pvec)
        return pvec[i][j]

    def union(self,i1,j1,i2,j2):
        pvec = self.vis
        rank = self.rank
        ii1,jj1 = self.parent(i1,j1,pvec)
        ii2,jj2 = self.parent(i2,j2,pvec)
        if ii1 == ii2 and jj1 == jj2:
            return
        if rank[ii1][jj1] < rank[ii2][jj2]:
            pvec[ii1][jj1] = (ii2,jj2)
        elif rank[ii1][jj1] > rank[ii2][jj2]:
            pvec[ii2][jj2] = (ii1,jj1)
        else:
            pvec[ii1][jj1] = (ii2,jj2)
            rank[ii2][jj2]+=1
        return

    def numIslands(self, grid: List[List[str]]) -> int:
        n = len(grid)
        if n <1:
            return 0

        m = len(grid[0])
        if n == 1:
            if m < 1:
                return 0
            if m == 1:
                if grid[0][0] == '1':
                    return 1
                return 0

        self.vis = [[(j,i) for i in range(m)] for j in range(n)]
        self.rank = [[0 for i in range(m)] for j in range(n)]
        vis = self.vis
        for i in range(n):
            for j in range(m):
                par = 0
                if grid[i][j] == '1':
                    if i > 0 and not par:
                        if grid[i-1][j] == '1':
                            self.union(i,j,i-1,j)
                    if i < n-1 and not par:
                        if grid[i+1][j] == '1':
                            self.union(i,j,i+1,j)
                    if j > 0 and not par:
                        if grid[i][j-1] == '1':
                            self.union(i,j,i,j-1)
                    if j < m-1 and not par:
                        if grid[i][j+1] == '1':
                            self.union(i,j,i,j+1)

        freq = [[0 for i in range(m)] for j in range(n)]
        res = 0
        for i in range(n):
            for j in range(m):
                if grid[i][j] == '1':
                    setx, sety = self.parent(i,j,vis)
                    if not freq[setx][sety]:
                        res+=1
                    freq[setx][sety]+=1
        return res

class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        if not len(grid):
            return 0

        def dfs(grid,row,col):
            if row < 0 or row >= len(grid) or col < 0 or col >= len(grid[0]) or grid[row][col] == "0":
                return
            grid[row][col] = "0"
            dfs(grid,row+1,col)
            dfs(grid,row-1,col)
            dfs(grid,row,col+1)
            dfs(grid,row,col-1)

        count = 0
        for row in range(len(grid)):
            for col in range(len(grid[0])):
                if grid[row][col] == "1":
                    count += 1
                    dfs(grid,row,col)
        return count

class Solution:
    def __init__(self):
        self.size = 0
    def numIslands(self, grid: List[List[str]]) -> int:
        if not len(grid):
            return 0
        visited = [[False for val in row] for row in grid]
        for row in range(len(grid)):
            for col in range(len(grid[0])):
                if visited[row][col]:
                    continue
                self.findIslands(grid,row,col,visited)
        return self.size
    def findIslands(self,grid,row,col,visited):
        riversize = 0
        explore = [[row,col]]
        while len(explore):
            row,col = explore.pop()
            if visited[row][col]:
                continue
            visited[row][col] = True
            if grid[row][col] == "0":
                continue
            riversize+=1
            unvisited = self.getNeighbours(grid,row,col,visited)
            if len(unvisited):
                for node in unvisited:
                    explore.append(node)
        if riversize > 0:
            self.size+=1

    def getNeighbours(self,grid,row,col,visited):
        unvisited = []
        if row > 0 and not visited[row-1][col]:
            unvisited.append([row-1,col])
        if row < len(grid)-1 and not visited[row+1][col]:
            unvisited.append([row+1,col])
        if col > 0 and not visited[row][col-1]:
            unvisited.append([row,col-1])
        if col < len(grid[0])-1 and not visited[row][col+1]:
            unvisited.append([row,col+1])
        return unvisited

